import React, { useState } from 'react';
import { Formik, Form, Field } from 'formik';
import * as Yup from 'yup';

const validationSchema = Yup.object().shape({
  name: Yup.string().required('Name is required'),
  age: Yup.number().required('Age is required').positive().integer(),
  role: Yup.string().required('Role is required'),
  team: Yup.string().required('Team is required')
});

export default function PlayerProfile() {
  const [avatar, setAvatar] = useState('/default-avatar.png');

  const initialValues = {
    name: '',
    age: '',
    role: '',
    team: '',
    specialization: '',
    experience: ''
  };

  return (
    <div className="max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold text-gray-800 mb-8">Player Profile</h1>

      <div className="bg-white rounded-lg shadow p-6">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
          <div className="text-center">
            <div className="w-48 h-48 mx-auto bg-gray-200 rounded-full overflow-hidden mb-4">
              <img src={avatar} alt="Player avatar" className="w-full h-full object-cover" />
            </div>
            <button className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600">
              Update Photo
            </button>
          </div>

          <Formik
            initialValues={initialValues}
            validationSchema={validationSchema}
            onSubmit={(values) => {
              console.log(values);
            }}
          >
            {({ errors, touched }) => (
              <Form className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700">Name</label>
                  <Field
                    name="name"
                    className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
                    type="text"
                  />
                  {errors.name && touched.name && (
                    <div className="text-red-500 text-sm">{errors.name}</div>
                  )}
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Age</label>
                  <Field
                    name="age"
                    className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
                    type="number"
                  />
                  {errors.age && touched.age && (
                    <div className="text-red-500 text-sm">{errors.age}</div>
                  )}
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Role</label>
                  <Field
                    name="role"
                    as="select"
                    className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
                  >
                    <option value="">Select Role</option>
                    <option value="batsman">Batsman</option>
                    <option value="bowler">Bowler</option>
                    <option value="all-rounder">All-Rounder</option>
                  </Field>
                  {errors.role && touched.role && (
                    <div className="text-red-500 text-sm">{errors.role}</div>
                  )}
                </div>

                <button
                  type="submit"
                  className="w-full bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
                >
                  Save Profile
                </button>
              </Form>
            )}
          </Formik>
        </div>
      </div>
    </div>
  );
}
